import React from 'react'
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Navbar from './components/NavBar';
import News from './components/News';
export default function App() {
  return (

    <div>
       <BrowserRouter>
       <Navbar/>
       <Routes>
       <Route
           exact path="/"
           element={<News key="Home" pagesize={4} country="in" category="general" />}
         />
         <Route
           exact path="/general"
           element={<News key="general" pagesize={4} country="in" category="general" />}
         />
         <Route
           exact path="/business"
           element={<News key="business" pagesize={4} country="in" category="business" />}
         />
         <Route
           exact path="/health"
           element={<News key="health" pagesize={4} country="in" category="health" />}
         />
         <Route
           exact path="/science"
           element={<News key="science" pageSize={4} country="in" category="science" />}
         />
         <Route
           exact path="/technology"
           element={<News key="technology" pagesize={4} country="in" category="technology" />}
         />
         <Route
           exact path="/sports"
           element={<News key="sports" pagesize={4} country="in" category="sports" />}
         />
       </Routes>
     </BrowserRouter>
    </div>
  )
}
